Save for your next trip.  Home from @paraderohotels after a magical 72 hours.

@paraderohotels is absolutely stunning.  Architecturally beautifully, sexy and remote.  You feel like you’re in another world. It’s located in Todos Santos (about an hour north of Cabo San Lucas on the pacific coast). 

This was my first time in Todos Santos, and definitely not my last.  The town is historic and charming, with great food and shops.  We ate at @oystera_ts (and had some of the best fish of my life), and shopped at @nomadchicmx (would definitely recommend both)

@paraderohotels is unlike any place I’ve ever stayed.  It’s about a 10 minute drive to the beach, but the hotel has a beautiful set up there and makes everything so easy.  They’ll arrange surf lessons, cooking classes, trips into town.  The staff is phenomenal - and the food is out of this world.  Don’t miss out on the traditional tezmacal ceremony while you’re there too.  A detox for the mind and body that’s incredibly healing.

So grateful to have shared this weekend with old and new friends - and can’t wait to get back.
